css:
html,
body,
.tree-view,
.tooltip,
.tab-bar .tab,
.find-and-replace .find-meta-container,
atom-text-editor[mini],
.btn,
.status-bar,
linter-message {
  font-size: 1rem;
}
atom-text-editor::shadow .comment {
  color: rgba(0, 255, 120, 0.5);
}
atom-text-editor::shadow .punctuation.definition.comment {
  color: rgba(0, 255, 120, 0.5);
}
atom-text-editor::shadow .gutter .line-number {
  color: rgba(232, 215, 215, 0.7);
}
atom-text-editor::shadow .gutter .cursor-line {
  color: white;
}
atom-text-editor::shadow .line.highlight-line {
  background: rgba(150, 150, 150, 0.5) !important;
}
atom-text-editor::shadow .line.highlight-line-multi-line-solid-bottom {
  border-bottom-color: red;
}
atom-text-editor::shadow .line.highlight-line-multi-line-solid-top {
  border-top-color: red;
}
